commit_message:
Update SerializablePrincipal.java https://github.com/picketbox/picketbox/blob/eaed8ecb93e6ce002eb50d2f515df032e2013839/picketbox-infinispan/src/main/java/org/jboss/security/authentication/JBossCachedAuthenticationManager.java#L74

JBossCachedAuthenticationManager.domainCache() will use Principal as map key,
so the implement class of Principal should implement method equals() and hashCode();
